import React, { useEffect } from 'react'
import Aos from 'aos'
import { IntroductionContainer, TextContainer, ImageContainer, Image } from './introduction.styles'

const Introduction = React.forwardRef((props, ref) => {
  useEffect(() => {
    Aos.init({ duration: 2000 })
  },[])

  return (
    <IntroductionContainer ref={ref}>
      <TextContainer data-aos="fade-up-right">Hi, my name is <span>Anne Nguyen</span> <br/> I'm a Web Developer</TextContainer>
      <ImageContainer data-aos="fade-down-left"><Image /></ImageContainer>
    </IntroductionContainer>
  )
})

export default Introduction
